import React, { Component, useEffect, useState } from "react";
import { Button } from "react-bootstrap";

export default function Subscription() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/api/Domain/SubscriptionStyle")
      .then((res) => res.json())
      .then((res) => {
        setData(res);
      });
  }, []);

  return (
    <div>
      <h1>Subscription:</h1>
      {data.map((post) => {
        return (
          <>
            <strong>
              {post.subscriptionStyleId}. {post.nameSubscription}
            </strong>
            <div>
              {post.description} - {post.cost}
            </div>
            <Button>Buy</Button>
          </>
        );
      })}
    </div>
  );
}
